import React from 'react';
import { useLocation } from 'react-router-dom';

const ResultPage = () => {
  const location = useLocation();
  const resultData = location.state?.resultData;

  return (
    <div>
      <h2>Loan Application Result</h2>
      {resultData ? (
        <div>
          <p>Full Name: {resultData.Full_Name}</p>
          <p>Address: {resultData.Address}</p>
          <p>PAN Number: {resultData.PAN_Number}</p>
          <p>Loan Amount: {resultData.Loan_Amount}</p>
          <p>EMI: {resultData.EMI}</p>
          <p>Interest Rate: {resultData.Interest_Rate}</p>
          {/* Add other result fields here */}
        </div>
      ) : (
        <p>No data available.</p>
      )}
    </div>
  );
};

export default ResultPage;
